// Sidebar.js
import React from 'react';
import { Link } from 'react-router-dom';

const Sidebar = () => {
  return (
    <div className="sidebar">
      <Link to="/policies">Policies</Link>
      <Link to="/users">Users</Link>
      <Link to="/roles">Roles</Link>
    </div>
  );
};

export default Sidebar;
